import React, { Component } from 'react';
import loslagos_1 from './img/loslagos_1.png';
import loslagos_2 from './img/loslagos_2.png';

class Home extends Component {
    state = {
        img: "https://i.vimeocdn.com/portrait/58832_300x300"
    }

    render() {
        return (
            <div class = '/'>
                <img
                    src={this.state.img}
                    onMouseEnter={() => {
                        this.setState({
                            img: "http://www.toptipsclub.com/Images/page-img/keep-calm-and-prepare-for-a-test.png"
                        })
                    }}

                    onMouseOut={() => {
                        this.setState({
                            img: "https://i.vimeocdn.com/portrait/58832_300x300"
                        })
                    }}
                />
            </div>
        )
    }
};

export default Home;
